dataprocessscript.script:
import java.util.Properties;
import java.io.InputStream;
import com.boomi.execution.ExecutionUtil;
import groovy.json.JsonSlurper;



// Retrieve current Dynamic Process Property value
String DPP_DYNAMIC_SQL_STATEMENT = ExecutionUtil.getDynamicProcessProperty("DPP_DYNAMIC_SQL_STATEMENT");

 // Replace the SQL placeholder for DPP_WORKDATEFROM
if (DPP_DYNAMIC_SQL_STATEMENT != null)
    DPP_DYNAMIC_SQL_STATEMENT = DPP_DYNAMIC_SQL_STATEMENT.replaceAll('<<DPP_UPDATEFROM>>', ExecutionUtil.getDynamicProcessProperty("DPP_UPDATEFROM"))

 // Set the dynamic process property
ExecutionUtil.setDynamicProcessProperty("DPP_DYNAMIC_SQL_STATEMENT", DPP_DYNAMIC_SQL_STATEMENT, false);

// Pass documents through...
for ( int i = 0; i < dataContext.getDataCount(); i++ ) {
  InputStream is = dataContext.getStream(i);
  Properties props = dataContext.getProperties(i);

   // Get the input stream text (document) as string
  String dataText = is.text;

  // Store the modified data as a stream
  is = new ByteArrayInputStream(dataText.getBytes('UTF-8'));
  dataContext.storeStream(is, props);
}

